"""Para obter uma imagem em tons quentes é preciso que os valores do canal vermelho sejam aumentados e os valores do canal azul sejam diminuídos. Deste modo, para se obter uma imagem em tons frios é necessário fazer o contrário, aumentar o azul e diminuir o vermelho, enquanto que em ambos casos o verde permanece do mesmo jeito"""

# função que irá gerar valores entre 0 e 256
from scipy.interpolate import UnivariateSpline
def tabeladevalores(x, y):
  spline = UnivariateSpline(x, y)
  return spline(range(256))

"""## Tons frios"""

def tonsfrios(image):
    increaseLookupTable = tabeladevalores([0, 64, 128, 256], [0, 80, 160, 256])
    decreaseLookupTable = tabeladevalores([0, 64, 128, 256], [0, 50, 100, 256])
    red_channel, green_channel, blue_channel = cv2.split(image)
    red_channel = cv2.LUT(red_channel, increaseLookupTable).astype(np.uint8)
    blue_channel = cv2.LUT(blue_channel, decreaseLookupTable).astype(np.uint8)
    return cv2.merge((red_channel, green_channel, blue_channel))

cv2_imshow(tonsfrios(resized_2))

"""## Tons quentes"""

def tonsquente(image):
    increaseLookupTable = tabeladevalores([0, 64, 128, 256], [0, 80, 160, 256])
    decreaseLookupTable = tabeladevalores([0, 64, 128, 256], [0, 50, 100, 256])
    red_channel, green_channel, blue_channel = cv2.split(image)
    red_channel = cv2.LUT(red_channel, decreaseLookupTable).astype(np.uint8)
    blue_channel = cv2.LUT(blue_channel, increaseLookupTable).astype(np.uint8)
    return cv2.merge((red_channel, green_channel, blue_channel))

cv2_imshow(tonsquentes(resized_2))

